UML:TaggedValue.value:
O sistema deve permitir ao usuário acessar as funcionalidades conforme a permissão definida para cada perfil. As seguintes regras devem ser consideradas:

<u>Administrador:</u>
<ul>
	<li>Acesso a todas funcionalidades que o usuário comum tem.        </li>
	<li>Acesso ao controle dos demais usuários:  </li>
</ul>
        - Consultar;
        - Cadastrar;
        - Visualizar;
        - Alterar;
        - Desativar;

<b>Observação:</b> Um administrador, não poderá desativar o seu próprio perfil nem alterar seu tipo de perfil, apenas dos demais usuários(administradores ou não).

<u>Usuário:</u>
<ul>
	<li>Usuário:     </li>
</ul>
        - Consultar e alterar o próprio perfil;
&nbsp;
<ul>
	<li>Vendas:     </li>
</ul>
        - Consultar;
        - Cadastrar;
        - Visualizar;
        - Alterar;
        - Estornar;
&nbsp;
<ul>
	<li>Produtos:     </li>
</ul>
        - Consultar;
        - Cadastrar;
        - Visualizar;
        - Alterar;
        - Excluir;
